const FilterToggles = (props) => {

    const handleCheck = (e) => {
        if (e.target.checked == false || e.target.checked == null){
            e.target.checked = true
        } else {e.target.checked = false}
    }


return(
    <div className= "">
        <input type="checkbox" id="scales" onClick= {(e)=> handleCheck(e)} name={props.trait.name} checked= {null}/> {props.trait.name}

    </div>
)
}
export default FilterToggles
